"use strict";
const { Model } = require("sequelize");
module.exports = (sequelize, DataTypes) => {
  class ReservationTicket extends Model {
    /**
     * Helper method for defining associations.
     * This method is not a part of Sequelize lifecycle.
     * The `models/index` file will call this method automatically.
     */
    static associate(models) {
      ReservationTicket.belongsTo(models.User, {
        foreignKey: "userId",
        targetKey: "id",
        as: "userDataToReservationTicket",
      });

      ReservationTicket.hasMany(models.MedicalPackage, {
        foreignKey: "reservationticketId",
        as: "ReservationTicketDataToMedicalPackage",
      });
    }
  }
  ReservationTicket.init(
    {
      bookingDate: DataTypes.STRING,
      userId: DataTypes.STRING,
    },
    {
      sequelize,
      modelName: "ReservationTicket",
    }
  );
  return ReservationTicket;
};

