const db = require("../models/index");

let createNewMealtime = async (id) => {
  return new Promise(async (resolve, reject) => {
    try {
      let createMealday = await db.Mealday.create({
        mealday: id.mealday,
      });

      let createMenu = await db.Menu.create({
        dietDesc: id.dietDesc,
        dietImage: id.dietImage,
      });

      let createMealtime = await db.Mealtime.create({
        mealtime: mealtime,
        mealdayId: createMealday.id,
        menuId: createMenu.id,
      });
      resolve({
        code: 0,
        message: "create sucess",
      });
    } catch (e) {
      reject(e);
    }
  });
};

