let deleteMealtime = (id) => {
  return new Promise(async (resolve, reject) => {
    let delmealtime = await db.Mealtime.findOne({
      where: { id: id },
    });
    if (!delmealtime) {
      resolve({
        code: 2,
        message: `mealtime not exist`,
      });
    } else {
      await db.Mealtime.destroy({
        where: { id: delmealtime.id },
      });

      await db.Mealday.destroy({
        where: { id: delmealtime.mealdayId },
      });

      await db.Menu.destroy({
        where: { id: delmealtime.menuId },
      });
    }
    resolve({
      code: 0,
      message: `success`,
    });
  });
};

module.exports = {
  createNewMealtime: createNewMealtime,
  // updateMealtime: updateMealtime,
  deleteMealtime: deleteMealtime,
};

