const db = require("../models/index");

let checkMedicaltypeName = (tenloai) => {
  return new Promise(async (resolve, reject) => {
    try {
      let nametype = await db.MedicalType.findOne({
        where: { name: tenloai },
      });
      if (nametype) {
        resolve(true);
      } else {
        resolve(false);
      }
    } catch (e) {
      reject(e);
    }
  });
};

let createNewMedicaltype = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      let check = await checkMedicaltypeName(data.name);
      if (check === true) {
        resolve({
          code: 1,
          message: "Tn loi thuc  tn ti, vui lng nhp li!",
        });
      } else {
        await db.MedicalType.create({
          name: data.name,
        });
      }
      resolve({
        code: 0,
        message: "Thm loi thuc thnh cng!",
      });
    } catch (e) {
      reject(e);
    }
  });
};

let updateMedicalType = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.id) {
        resolve({
          code: 2,
          message: "Error updating!",
        });
      } else {
        let tenloai = await db.MedicalType.findOne({
          where: { id: data.id },
          raw: false,
        });
        if (tenloai) {
          let check = await checkMedicaltypeName(data.name);
          if (check === true) {
            resolve({
              code: 1,
              message: "Tn loi thuc  tn ti, vui lng nhp li!",
            });
          } else {
            tenloai.name = data.name;
            await tenloai.save();
            resolve({
              code: 0,
              message: "Cp nht loi thuc thnh cng",
            });
          }
        } else {
          resolve({
            code: 1,
            message: "Khng tm thy loi thuc",
          });
        }
      }
    } catch (e) {
      reject(e);
    }
  });
};

let deleteMedicalType = (id) => {
  return new Promise(async (resolve, reject) => {
    try {
      let timloai = await db.MedicalType.findOne({
        where: { id: id },
      });
      if (!timloai) {
        resolve({
          code: 2,
          message: "Loi thuc khng tn ti!",
        });
      }
      await db.MedicalType.destroy({
        where: { id: id },
      });
      resolve({
        code: 0,
        message: "Xa loi thuc thnh cng!",
      });
    } catch (e) {
      reject(e);
    }
  });
};

let getAllMedicalTypes = () => {
  return new Promise(async (resolve, reject) => {
    try {
      let medicaltypes = {};
      medicaltypes = await db.MedicalType.findAll({
        include: [
          {
            model: db.Medical,
            as: "medicalTypeDataToMedical",
            attributes: ["name", "id"],
          },
        ],
        raw: true,
        nest: true,
      });
      resolve(medicaltypes);
    } catch (e) {
      reject(e);
    }
  });
};

module.exports = {
  createNewMedicaltype: createNewMedicaltype,
  updateMedicalType: updateMedicalType,
  deleteMedicalType: deleteMedicalType,
  getAllMedicalTypes: getAllMedicalTypes,
};

