const db = require("../models/index");

let getAllMedicals = () => {
  return new Promise(async (resolve, reject) => {
    try {
      let medicals = {};
      medicals = await db.Medical.findAll({
        // attributes: ["image"],
        include: [
          {
            model: db.MedicalType,
            as: "medicalTypeDataToMedical",
            attributes: ["name", "id"],
          },
          {
            model: db.Donvitinh,
            as: "donvitinhDataToMedical",
            attributes: ["donvitinh", "id"],
          },
          {
            model: db.Nhacungcap,
            as: "nhacungcapDataToMedical",
            attributes: ["nhacungcap", "id"],
          },
        ],
        raw: true,
        nest: true,
      });
      resolve(medicals);
    } catch (e) {
      reject(e);
    }
  });
};

let checkMedicalName = (tenthuoc) => {
  return new Promise(async (resolve, reject) => {
    try {
      let medicalname = await db.Medical.findOne({
        where: { name: tenthuoc },
      });
      if (medicalname) {
        resolve(true);
      } else {
        resolve(false);
      }
    } catch (e) {
      reject(e);
    }
  });
};

let createNewMedical = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      let check = await checkMedicalName(data.name);
      if (check === true) {
        resolve({
          code: 1,
          message: "Tn thuc  tn ti, vui lng nhp li!",
        });
      } else {
        await db.Medical.create({
          name: data.name,
          image: data.image,
          donvitinhId: data.donvitinhId,
          nhacungcapId: data.nhacungcapId,
          medicalTypeId: data.medicalTypeId,
        });
      }
      resolve({
        code: 0,
        message: "Thm thuc thnh cng!",
      });
    } catch (e) {
      reject(e);
    }
  });
};

let updateMedical = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.id) {
        resolve({
          code: 2,
          message: "Error updating!",
        });
      } else {
        let tenthuoc = await db.Medical.findOne({
          where: { id: data.id },
          raw: false,
        });
        if (tenthuoc) {
          let check = await checkMedicalName(data.name);
          if (check === true) {
            resolve({
              code: 1,
              message: "Tn thuc  tn ti, vui lng nhp li!",
            });
          } else {
            tenthuoc.name = data.name;
            await tenthuoc.save();
            resolve({
              code: 0,
              message: "Cp nht thuc thnh cng",
            });
          }
        } else {
          resolve({
            code: 1,
            message: "Khng tm thy thuc",
          });
        }
      }
    } catch (e) {
      reject(e);
    }
  });
};

let deleteMedical = (id) => {
  return new Promise(async (resolve, reject) => {
    try {
      let timthuoc = await db.Medical.findOne({
        where: { id: id },
      });
      if (!timthuoc) {
        resolve({
          code: 2,
          message: "Thuc khng tn ti!",
        });
      }
      await db.Medical.destroy({
        where: { id: id },
      });
      resolve({
        code: 0,
        message: "Xa loi thuc thnh cng!",
      });
    } catch (e) {
      reject(e);
    }
  });
};

module.exports = {
  createNewMedical: createNewMedical,
  getAllMedicals: getAllMedicals,
  updateMedical: updateMedical,
  deleteMedical: deleteMedical,
};

