import express from "express";
import {
  handleDeleteUser,
  handleEditUser,
  handleCreateNewUser,
  handleGetAllUsers,
} from "../controllers/userController";
import { verifyUser, adminOnly } from "../middleware/AuthUser.js";

const router = express.Router();

router.get("/api/get-all-users", verifyUser, adminOnly, handleGetAllUsers);
router.post("/api/create-new-user", verifyUser, adminOnly, handleCreateNewUser);
router.put("/api/edit-user", verifyUser, adminOnly, handleEditUser);
router.delete("/api/delete-user", verifyUser, adminOnly, handleDeleteUser);

export default router;

