const db = require("../models/index");
const { createNewMedicalpackage } = require("./medicalpackageService");
const { getSearchParentById } = require("./patientService");

let getAllParents = () => {
  return new Promise(async (resolve, reject) => {
    try {
      let parents = {};
      parents = await db.Parent.findAll({
        include: [
          {
            model: db.Allcode,
            as: "genderDataToParent",
            attributes: ["value", "keyMap", "type"],
          },
        ],
      });
      resolve(parents);
    } catch (e) {
      reject(e);
    }
  });
};

let loginParent = (email, password) => {
  console.log("email", email);
  console.log("password", password);
  return new Promise(async (resolve, reject) => {
    try {
      let parentData = {};
      let isExist = await checkParentEmail(email);
      if (isExist) {
        let parent = await db.Parent.findOne({
          attributes: ["email", "password", "name", "gender", "phone", "id"],
          where: { email: email },
          include: [
            {
              model: db.Patient,
              as: "parentDataToPatient",
              attributes: [
                "id",
                "childrentName",
                "gender",
                "birthday",
                "address",
              ],
            },
          ],
          // raw: true,
        });
        if (parent) {
          //compare password
          // let check = true;
          if (password == parent.password) {
            parentData.code = 0;
            (parentData.message = "Ok"), delete parent.password;
            parentData.parent = parent;
          } else {
            parentData.code = 3;
            parentData.message = "Sai mt khu !";
          }
        } else {
          parentData.code = 2;
          parentData.message = `Khng tm ngi dng !`;
        }
      } else {
        //return error
        parentData.code = 1;
        parentData.message = `Ti khon khng tn ti !`;
      }
      resolve(parentData);
    } catch (e) {
      reject(e);
    }
  });
};

let checkParentEmail = (parentEmail) => {
  return new Promise(async (resolve, reject) => {
    try {
      let parent = await db.Parent.findOne({
        where: { email: parentEmail },
      });
      if (parent) {
        resolve(true);
      } else {
        resolve(false);
      }
    } catch (e) {
      reject(e);
    }
  });
};

let createNewParentPatient = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      let check = await checkParentEmail(data.email);
      if (data.email === "") {
        resolve({
          code: 2,
          message: "Vui lng nhp email !",
        });
      } else {
        if (check === true) {
          resolve({
            code: 1,
            message: "Email  tn ti, vui lng nhp li!",
          });
        } else {
          let parent = await db.Parent.create({
            name: data.name,
            email: data.email,
            password: data.password,
            phone: data.phone,
            gender: data.genderparent,
          });

          let patient = await db.Patient.create({
            childrentName: data.childrentName,
            gender: data.genderpatient,
            birthday: data.birthday,
            address: data.address,
            image: data.image,
            parentId: parent.id,
          });
          if (patient) {
            resolve(patient);
          }
        }
      }
      resolve({
        code: 0,
        message: "To thnh cng !",
      });
    } catch (e) {
      reject(e);
    }
  });
};

let createNewParent = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      let check = await checkParentEmail(data.email);
      if (check === true) {
        resolve({
          code: 1,
          message: "Email  tn ti, vui lng nhp li!",
        });
      } else {
        const id = await db.Parent.create({
          name: data.name,
          email: data.email,
          password: data.password,
          phone: data.phone,
          gender: data.gender,
        });
        resolve({
          code: 0,
          message: "success",
          id,
        });
      }
    } catch (e) {
      reject(e);
    }
  });
};

let updateParentData = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.id) {
        resolve({
          code: 2,
          message: "err",
        });
      } else {
        let parent = await db.Parent.findOne({
          where: { id: data.id },
          raw: false,
        });
        if (parent) {
          parent.name = data.name;
          parent.email = data.email;
          parent.password = data.password;
          parent.phone = data.phone;
          parent.gender = data.gender;
          await parent.save();
          resolve({
            code: 0,
            message: "Cp nht ngi i din tr thnh cng!",
          });
        } else {
          resolve({
            code: 1,
            message: `Khng tm thy ngi i din tr!`,
          });
        }
      }
    } catch (e) {
      reject(e);
    }
  });
};

let getParent = (parentId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let parent = "";
      if (parentId && parentId !== "ALL") {
        parent = await db.Parent.findOne({
          where: { id: parentId },
          include: [
            {
              model: db.Patient,
              as: "parentDataToPatient",
              attributes: [
                "childrentName",
                "gender",
                "birthday",
                "address",
                "image",
                "id",
              ],
              include: [
                {
                  model: db.Allcode,
                  as: "genderDataToPatient",
                  attributes: ["value", "keyMap", "type"],
                },
              ],
            },
            {
              model: db.Allcode,
              as: "genderDataToParent",
              attributes: ["value", "keyMap", "type"],
            },
          ],
        });
      }
      resolve(parent);
    } catch (e) {
      reject(e);
    }
  });
};

let findPatient = (patient) => {
  return new Promise(async (resolve, reject) => {
    try {
      let find = await db.Patient.findOne({
        where: { parentId: patient },
      });
      if (find) {
        resolve(find);
      } else {
        resolve(false);
      }
    } catch (e) {
      reject(e);
    }
  });
};

let deleteParent = (data) => {
  return new Promise(async (resolve, reject) => {
    if (!data.id) {
      resolve({
        code: 2,
        message: "Missing required parameters",
      });
    } else {
      let del = await db.Parent.findOne({
        where: { id: data.id },
        raw: false,
      });
      if (!del) {
        resolve({
          code: 2,
          message: `Ngi dng khng tn ti`,
        });
      } else {
        let check = await findPatient(data.id);
        if (check) {
          resolve({
            code: 1,
            message: " tn ti ... ",
          });
        } else {
          await db.Parent.destroy({ where: { id: data.id } });
        }
        resolve({
          code: 0,
          message: "Xa thnh cng!",
        });
      }
    }
  });
};

// let deleteParent = (data) => {
//   return new Promise(async (resolve, reject) => {
//     try {
//       let check = await findPatient(data.parentId);
//       let find = await db.Parent.findOne({
//         where: { id: data },
//       });
//       if (!find.id) {
//         resolve({
//           code: 2,
//           message: `Ngi dng khng tn ti`,
//         });
//       } else {
//         if (check === true) {
//           resolve({
//             code: 1,
//             message: " tn ti bnh nhn, khng th xa!",
//           });
//         } else {
//           await db.Parent.destroy({
//             where: { id: parent },
//           });
//           resolve({
//             code: 0,
//             message: ` xa ngi i din thnh cng`,
//           });
//         }
//       }
//     } catch (e) {
//       reject(e);
//     }
//   });
// };

module.exports = {
  createNewParent: createNewParent,
  getAllParents: getAllParents,
  updateParentData: updateParentData,
  deleteParent: deleteParent,
  getParent: getParent,
  findPatient: findPatient,
  createNewParentPatient: createNewParentPatient,
  loginParent: loginParent,
};

