const db = require("../models/index");

let createNewTimeslot = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      await db.TimeSlot.create({
        timeslot: data.timeslot,
      });
      resolve({
        code: 0,
        message: "Thm thnh cng!",
      });
    } catch (e) {
      reject(e);
    }
  });
};

let updateTimeslot = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.id) {
        resolve({
          code: 2,
          message: "err",
        });
      } else {
        let khunggio = await db.TimeSlot.findOne({
          where: { id: data.id },
          raw: false,
        });
        if (khunggio) {
          khunggio.timeslot = data.timeslot;
          await khunggio.save();
          resolve({
            code: 0,
            message: "Cp nht thnh cng!",
          });
        } else {
          resolve({
            code: 1,
            message: `Khng tm thy khung gi!`,
          });
        }
      }
    } catch (e) {
      reject(e);
    }
  });
};

let deleteMedical = (timeslotId) => {
  return new Promise(async (resolve, reject) => {
    let found = await db.TimeSlot.findOne({
      where: { id: timeslotId },
    });
    if (!found) {
      resolve({
        code: 2,
        message: `Khng tn ti khung gi`,
      });
    }
    await db.TimeSlot.destroy({
      where: { id: timeslotId },
    });
    resolve({
      code: 0,
      message: ` xa khung gi`,
    });
  });
};

let getAllTimeslots = () => {
  return new Promise(async (resolve, reject) => {
    try {
      let timeslots = {};
      timeslots = await db.TimeSlot.findAll();
      resolve(timeslots);
    } catch (e) {
      reject(e);
    }
  });
};

let getATimeslot = (timeslotId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let timeslot = "";
      if (timeslotId && timeslotId !== "ALL") {
        timeslot = await db.TimeSlot.findOne({
          where: { id: timeslotId },
        });
      }
      resolve(timeslot);
    } catch (e) {
      reject(e);
    }
  });
};

module.exports = {
  deleteMedical: deleteMedical,
  updateTimeslot: updateTimeslot,
  createNewTimeslot: createNewTimeslot,
  getAllTimeslots: getAllTimeslots,
  getATimeslot: getATimeslot,
};

