sourcesContent:
"use strict";
const { Model } = require("sequelize");
module.exports = (sequelize, DataTypes) => {
  class RegisterDate extends Model {
    /**
     * Helper method for defining associations.
     * This method is not a part of Sequelize lifecycle.
     * The `models/index` file will call this method automatically.
     */
    static associate(models) {
      // RegisterDate.belongsTo(models.DayOfWeek, {
      //   foreignKey: "dayofweekId",
      //   targetKey: "id",
      //   as: "dayOfWeekDataToRegisterDate",
      // });
      RegisterDate.hasMany(models.Schedule, {
        foreignKey: "registerdateId",
        as: "registerDateDataToSchedule",
      });
    }
  }
  RegisterDate.init(
    {
      date: DataTypes.STRING,
    },
    {
      sequelize,
      modelName: "RegisterDate",
    }
  );
  return RegisterDate;
};

