sourcesContent:
require("dotenv").config();
const nodemailer = require("nodemailer");

let sendSimpleEmail = async (dataSend) => {
  let transporter = nodemailer.createTransport({
    host: "smtp.gmail.com",
    port: 587,
    secure: false,
    auth: {
      user: process.env.EMAIL_APP,
      pass: process.env.EMAIL_APP_PASSWORD,
    },
  });

  let info = await transporter.sendMail({
    from: '"Nguyen Thi Thu Quyen " <nttquyen1902@gmail.com>',
    to: dataSend.reciverEmail,
    subject: "THNG TIN T LCH T VN",
    text: "Hello world?",
    html: `
    <h3>Xin cho ${dataSend.name}</h3>
    <p>Cm n bn  t lch t vn ti Children's Care</p>
    <p>Thng tin chi tit:</p>
    <div><b>Tn ngi i din: ${dataSend.name}</b></div>
    <div><b>S in thoi: ${dataSend.phone}</b></div>
    <div><b>Tn tr: ${dataSend.childrentName}</b></div>
    <div><b>Ngy sinh: ${dataSend.birthday}</b></div>
    <div><b>Gii tnh: ${dataSend.gender}</b></div>

    <p>Thng tin t vn:</p>
    <div><b>Gi t vn: ${dataSend.testGoiKham}</b></div>
    <div><b>Gi t vn: ${dataSend.testGiaGoiKham}</b></div>
    <div><b>Ngy t vn: ${dataSend.arrivalDate}</b></div>
    <div><b>khung gi t vn: ${dataSend.testTimeslot}</b></div>
    <div></div>
    `,
  });
};

module.exports = {
  sendSimpleEmail: sendSimpleEmail,
};

